import React from 'react'
import Navbar from '../../components/navbar/Navbar'
import './School.css';

function School() {
  const externalImage =
    'https://res.cloudinary.com/do0puhubq/image/upload/v1674985967/Schools/AUBhome_gvbnvj.jpg';
  return (

    <div>
      <Navbar />
      <p>
        <center>
        <h2><span className=''>American University of Beirut</span>  Dorms</h2>
          <img className='imageflu' src={externalImage} />
        </center>
</p>
    </div>
  )
}

export default School
